@import url("https://fonts.googleapis.com/css2?family=Montserrat&display=swap");

* {
  font-family: "Montserrat", sans-serif;
}

.bg-red {
  background-color: crimson;
}

.bg-white {
  background-color: white;
}

.container-wrapper {
  width: 250px;
  height: 100vh;
  background-color: deepskyblue;
  color: white;
  position: fixed;
  top: 0;
  text-align: center;
  transition: all 0.3s ease-in-out;
}

.item {
  width: 95%;
  padding: 14px 0;
  padding-left: 12px;
  cursor: pointer;
  text-align: left;
}

.item:hover {
  background-color: #0377da;
  transition: all 0.3s ease-in-out;
}

.icon {
  padding-right: 10px;
  display: inline-block;
  width: 20%;
  font-size: 15px;
}

.bg-blue {
  background-color: #3960d0;
  color: white;
}

.bg-blue .item:hover {
  background-color: #0541aa;
}

.blue-hover:hover {
  background-color: #609beb;
  color: white;
}

.bg-light {
  background-color: #fffeff;
  color: black;
}

.light-hover:hover {
  background-color: #f6f6f6;
}

.bg-light .item:hover {
  background-color: #1c1e2a;
  color: white;
}

.bg-black {
  background-color: #1c1e2a;
  color: white;
}

.bg-black .item:hover {
  background-color: white;
  color: #1c1e2a;
}

.black-hover:hover {
  background-color: #2c2f3e;
  color: white;
}

.dropdown-item {
  text-align: left;
  cursor: pointer;
}

.mx-1 {
  margin: 0 1em;
}

.d-none {
  display: none;
}

.d-block {
  display: block;
  position: relative;
}

.logo-image {
  width: 100px;
  margin-top: 1em;
}

.toggler {
  position: absolute;
  right: 15px;
  top: 15px;
  font-size: 22px;
  cursor: pointer;
}

.collapsed {
  width: 85px;
}

input {
  padding: 12px 20px;
  margin: 15px 0;
  box-sizing: border-box;
}

.pos-left {
  left: 0;
}

.pos-right {
  right: 0;
}

.bg-peach {
  background-color: #fd7e65;
  color: white;
}

.bg-peach-hover:hover {
  background-color: #fd9768;
}

.bg-peach .item:hover {
  background-color: white;
  color: #fd7e65;
}

.bg-purple {
  background-color: #a771e4;
  color: white;
}

.bg-purple .item:hover {
  background-color: #7f00be;
}

.bg-purple-hover:hover {
  background-color: #e26fcf;
}

.bg-aqua {
  background-color: #1da4f4;
  color: white;
}

.bg-aqua-hover:hover {
  background-color: #16bcde;
}

.float-right {
  float: right;
}
